import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import Dialog from './Dialog'

class Navbar extends Component {
  constructor(props){
    super(props)
    this.state = {
      showDialog: false
    }
  }

  toggleDialog = () => {
    this.setState({
      showDialog: !this.state.showDialog
    })
  }
  render() {
    let navClassList = ['navbar'];
    if (this.props.classes != undefined){
      navClassList = navClassList.concat(this.props.classes)
    }
    if(this.props.isDark){
      navClassList.push('dark')
    }
    return (
      <nav className={navClassList.join(" ")}>
        <Link to="/"><img src={this.props.isDark? "svgs/fat_bird_dark.svg":"svgs/fat_bird.svg"}/></Link>
        <span><Link to="/quiz"  className={this.props.active == "quiz"? "active" : null}>Quiz</Link></span>
        <span><Link to="/results" className={this.props.active == "results"? "active" : null}>Results</Link></span>
        <span><Link onClick={this.toggleDialog} className={this.props.active == "itinerary"? "active" : null}>Itinerary</Link></span>
        <span><Link onClick={this.toggleDialog} className={this.props.active == "book"? "active" : null}>Book</Link></span>
        <img src={this.props.isDark? "svgs/hamburger_dark.svg":"svgs/hamburger.svg"}/>
        {this.state.showDialog && <Dialog title="I'm not working yet" body="Check back later" toggleDialog={this.toggleDialog}/>}
      </nav>
    )
  }
}

export default Navbar;
